$translationStrings['L_MSG_APRESENTACAO_SISTEMA_OASIS']                                             = 'O Sistema de Gestão de Projetos, Demandas e Serviços de Tecnologia da Informação - OASIS foi iniciado no ano de 2005 buscando atender aos diversos acórdãos do TCU, direcionados ao Ministério de Desenvolvimento, Industria e Comércio Exterior – MDIC, referentes às licitações realizadas. Um dos acórdãos do TCU incluiu um item dirigido à Secretaria de Logística de Tecnologia da Informação – SLTI, do Ministério do Planejamento, para que fosse elaborada uma Instrução Normativa, baseada nos acórdãos do MDIC, sobre as contratações de TI no Governo. Em 20 de maio de 2008 foi publicada a IN SLTI nº 04, que entrou em vigor no dia 02 de janeiro de 2009, normalizando todo o processo de contratação. O OASIS, vem automatizar uma grande parte das funcionalidades encontradas na IN SLTI nº 04, principalmente em relação ao artigo 20.';
